import axios from 'axios';

const PeriodNavigation = async (page, limit) => {
  try {
    const response = await axios.get(`/http://localhost:8000/period/get?page=${page}&limit=${limit}`);
    return response.data;
    console.lo
  } catch (error) {
    console.error("Error fetching items:", error);
    throw error;
  }
};

export default PeriodNavigation;
